import React from "react"
import styled from "styled-components"

import cartImg from "../images/cartBtn.svg"


const CartBtn = styled.button`
    width:90px;
    height:45px;
    background-color:#FFFFFF;
    border-radius:8px;
`; 

const CartButton = (props:any)=>{


    return(
        <CartBtn>
            {cartImg}

        </CartBtn>

    )

}

export default CartButton
